(2684,'lunar','updated','product',14,'updated','staff',1,'{\"old\": {\"attribute_data\": {\"name\": {\"en\": \"T-Shirt 1\"}, \"description\": {\"en\": \"\"}}}, \"attributes\": {\"attribute_data\": {\"name\": {\"en\": \"Retake the Sky\"}, \"description\": {\"en\": \"<p>Designed by Evolve, this piece reflects on the emotional aftermath of the 2020 war, transforming a symbol of destruction into one of innovation and resilience. Centered beneath a rising sun over Mount Ararat, a sci-fi recon drone rises—not to terrorize, but to protect. The artwork merges ancient geography with futuristic defense, provoking thought on how we reclaim control through creation.</p>\"}}}}',NULL,'2025-06-03 08:09:36','2025-06-03 08:09:36'),
