INSERT INTO `lunar_products` VALUES
(1,1,1,'published','{\"name\": {\"value\": {\"en\": \"Levi\'s® 501® Straight Fit Jeans\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"A cultural icon worn by generations, defining style for decades. The iconic straight fit with the signature button fly. Since Levi\'s® invented it in 1873, people have made them their own by ripping, tearing, repairing, dying and marking them up for total \"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:47','2025-03-09 15:22:54','2025-03-09 15:22:54'),
(2,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Chuck 70 Raw Edge\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"details\": {\"value\": [\"High-top sneaker, crafted with organic canvas for an elevated look and feel\", \"OrthoLite cushioning for all-day comfort\", \"Raw-cut textile inserts for added padding\", \"Shiny rubber sidewall and winged tongue stitching\", \"Heritage details like a 1970s heel logo nod to its legacy\"], \"field_type\": \"Lunar\\\\FieldTypes\\\\ListField\"}, \"description\": {\"value\": {\"en\": \"The timeless style you know and love gets remixed with light padding and unexpected raw-edge details. An elevated style icon, it features more cushioning to keep you looking ”and feeling” good all day. The Chuck 70 holds its own on fashion week runways and city streets, making it the go-to sneaker for those looking to enhance and express their style.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:47','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(3,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Air Jordan\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Cold, wet weather usually means it\'s time to put away your J\'s until the spring.With the Air Jordan 1 Acclimate, those days are over.Part boot, part sneaker, it uses winterized materials in a toe-to-heel overhaul that\'s designed to help you stay warm and dry without losing the iconic AJ1 appeal.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:47','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(4,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"WORKER 20.5\\\" - CHINO SHORTS FOR MEN\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Our mens Original 20 joggers are a basic staple. Featuring everything you need from the perfect pair of relaxed trousers; draw cord and elasticated waist, elasticated cuffs for comfort fit, side and back pockets with a popper fastening and Saltrock branding. With a super soft, peach fluff finished inside for warmth and comfort.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(5,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Nike Sportswear Tech Fleece\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Ready for cooler weather, the Nike Sportswear Tech Fleece Joggers feature an updated fit perfect for everyday wear. Roomy through the thigh, this tapered design narrows at the knee to give you a comfortable feel without losing the clean, tailored look you love. Tall ribbed cuffs complete the jogger look while a zipped pocket on the right leg provides secure small-item storage and elevates the look.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(6,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"NICCE Mens Original Hood\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Original overhead hood featuring a white chest logo, with a drawstring hood, pouch pocket and cuffed sleeves and hem. A simple and easy piece, great to layer and throw on with jeans or joggers.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(7,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Nike Pegasus Trail 3\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Find your wings with an off-road run. The Nike Pegasus Trail 3 has the same cushioned comfort you love, with a design that nods to the classic Pegasus look. It\'s got tough traction to help you stay moving through rocky terrain. More support around the midfoot helps you feel secure on your journey.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(8,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Men\'s Full-Zip Fleece Hoodie\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Made in Milan, Italy with thoughtful consideration of every last detail, this full-zip hoodie is designed for lightweight warmth and 360 degrees of comfort. A buttery-soft blend of cotton, cashmere and elastane lies flat on your skin for a smooth feel.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(9,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Nike Red Hoodie\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"This Hoodie outfits you in cosy comfort that\'s easy to layer. It\'s made from soft, warm fleece with an oversized chest graphic to make it clear who you\'re repping.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(10,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Nike Metcon 7\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"The Nike Metcon 7 is the gold standard for weight training—even tougher and more stable than previous versions.We\'ve also added React foam that ups the comfort to keep you ready for high-intensity cardio.Plus, a tab locks down your laces so you can forget about them coming untied when you\'re focused on your next PR.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(11,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Nike Air Huarache\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Built to fit your foot and designed for comfort, the Nike Air Huarache brings back a street-level favourite. Updated with sleek colours, this version has soft, synthetic leather accents on the upper that mix with super-breathable, perfectly shined neoprene-like fabric for easy styling.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(12,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Women\'s Woven Tennis Trousers\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Made with multiple oversized pockets, the Naomi Osaka Trousers are a wardrobe staple with plenty of storage.Signature Naomi Osaka details, like her logo on the left pocket, put a premium spin on any outfit.\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(13,NULL,1,'published','{\"name\": {\"value\": {\"en\": \"Classic Hooded Sweat\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"Double fabric hood\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 14:40:48','2025-03-09 15:44:01','2025-03-09 15:44:01'),
(14,1,1,'draft','{\"name\": {\"value\": {\"en\": \"Retake the Sky\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"<p>Designed by Evolve, this piece reflects on the emotional aftermath of the 2020 war, transforming a symbol of destruction into one of innovation and resilience. Centered beneath a rising sun over Mount Ararat, a sci-fi recon drone rises—not to terrorize, but to protect. The artwork merges ancient geography with futuristic defense, provoking thought on how we reclaim control through creation.</p>\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-03-09 15:46:37','2025-06-03 08:22:52',NULL),
(15,1,1,'draft','{\"name\": {\"value\": {\"en\": \"Stonecode\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"<p>Designed by Evolve, Divine Circuit fuses ancient Armenian motifs with futuristic geometry in a piece that stands out without saying a word. Inspired by the sacred architecture of cross-stones and timeless ornamental patterns, this design reflects identity, resilience, and craft.<br><br>Digitally printed in rich gold tones on 100% black cotton, it’s built for the modern creative — those who move between tradition and innovation, and design their own path forward.</p>\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-06-03 08:20:21','2025-06-03 08:20:52',NULL),
(16,1,1,'draft','{\"name\": {\"value\": {\"en\": \"Sassoun’s Flame\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"<p>Evolve brings myth to life with The Horse of Sassoun, a tribute to the fiery stallion from the Armenian national epic, David of Sassoun. Rendered in abstract shapes and rich Armenian tones, this creature is more than a horse — it’s a symbol of loyalty, power, and the burning spirit of resistance.<br><br>Digitally printed on premium cotton in white and off-white, this piece is for those who carry legends on their backs — and move like they’re part of one.</p>\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-06-03 08:23:19','2025-06-03 08:26:01',NULL),
(17,1,1,'draft','{\"name\": {\"value\": {\"en\": \"Sacred Syntax\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"<p>Designed by Evolve, Golden Cipher fuses Armenian khachkar tradition with modern geometric abstraction. Inspired by sacred carvings and the flow of coded systems, this piece reflects the unbreakable lines between ancestry, faith, and structure.<br><br>Digitally printed in gold tones on premium black cotton, it’s made for those who move between the ancient and the future — wearing identity not as decoration, but as encrypted memory.</p>\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-06-03 08:39:10','2025-06-03 08:39:30',NULL),
(18,1,1,'draft','{\"name\": {\"value\": {\"en\": \"Recursive Maze\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"<p>Recursive Maze by Evolve is a visual echo of corrupted systems and broken architectures. Playing with depth, dimension, and miscommunication, the design captures the beauty of collapse — when order breaks into chaos and meaning slips through the gaps.<br><br>Digitally printed on black cotton, it’s a tribute to the digital generation raised on glitches, boot errors, and the strange poetry of the unknown.</p>\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-06-03 08:42:36','2025-06-03 08:44:30',NULL),
(19,1,1,'draft','{\"name\": {\"value\": {\"en\": \"Sacred Arch\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}, \"description\": {\"value\": {\"en\": \"<p>Designed by Evolve, Sacred Arch transforms spiritual architecture into pure form. Inspired by Armenian church windows and ancient sacred geometry, it channels the feeling of standing at a threshold — between past and present, light and shadow.<br><br>Digitally printed in bold black on off-white cotton, this piece is for the quiet observer, the architectural thinker, and anyone drawn to shapes that hold meaning without words.<br><br></p>\"}, \"field_type\": \"Lunar\\\\FieldTypes\\\\TranslatedText\"}}','2025-06-03 09:08:41','2025-06-03 09:13:32',NULL);
